INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1328, 'Rain', 'rain', '模拟和描绘下雨的情景。这种场景常常用来表达出雨水的纹理、湿润的氛围以及对情感或故事情节的渲染，为作品增添一种独特的氛围和情绪。', '风格', '主题场景', 0, '{}', 1, '2023-08-06 00:35:02', '2023-08-06 01:02:48');
