INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1330, 'Emo', 'emo', '模拟和表达情绪化、忧郁、内敛的情感状态。', '风格', '主题场景', 0, '{}', 1, '2023-08-06 00:35:03', '2023-08-06 01:02:48');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1331, 'Magical', 'magical', '模拟奇幻的世界，具有神秘、魔力和想象力的特点。', '风格', '主题场景', 0, '{}', 1, '2023-08-06 00:35:03', '2023-08-06 01:02:48');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1332, 'Retrofuturism', 'retrofuturism', '结合复古和未来元素，展现过去对未来的想象和设想。', '风格', '主题场景', 0, '{}', 1, '2023-08-06 00:35:03', '2023-08-06 01:02:48');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1333, 'Ethereal', 'ethereal', '模拟虚幻、超凡、超自然的场景和氛围。', '风格', '主题场景', 0, '{}', 1, '2023-08-06 00:35:03', '2023-08-06 01:02:48');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1334, 'spring(春天)', 'spring', '展现春季的美丽和活力。这种场景常常包含鲜花盛开、绿草如茵、温暖阳光等元素，传达出生机勃勃、希望和新开始的氛围。春天场景为作品注入一种明亮、欢快的气息，让人感受到春天带来的喜悦和美好。', '风格', '主题场景', 0, '{}', 1, '2023-08-06 00:35:03', '2023-08-06 01:02:48');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1335, 'gothic(哥特式)', 'gothic', '展现出哥特文化的特点和氛围。这种场景常常包含浓厚的黑暗、神秘和古老的元素，传达出一种阴郁、奇幻和神秘的氛围。哥特式场景为作品带来独特的风格和情绪，适用于表达奇幻、恐怖或神秘的主题。', '风格', '主题场景', 0, '{}', 1, '2023-08-06 00:35:03', '2023-08-06 01:02:49');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1336, '外星人', 'Alien', '描绘来自地球之外的生命形式，具有与人类不同的外貌、特征和文明，常出现在科幻作品中，引发人类对宇宙和未知生命的好奇与想象。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:49', '2023-08-06 00:36:49');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1337, '亚洲人', 'Asian', '描绘来自亚洲地区的人，具有亚洲人特有的面貌、特征和文化背景，是地理和文化多样性的代表，常用于艺术作品、文化表达和社会刻画的视觉形象。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:50', '2023-08-06 00:36:50');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1338, '婴儿', 'Baby', '描绘年幼的婴儿，通常具有可爱的外貌和无邪的表情，象征生命的纯真和无辜，常用于描绘亲子关系、成长和家庭主题的艺术作品。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:50', '2023-08-06 00:36:50');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1339, '邪恶', 'Evil', '描绘具有邪恶和恶意的角色，通常表现为黑暗、残忍和诡计多端，是故事中的反派角色，与正义和善良的角色形成对比，常用于文学、电影和游戏等创作。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:50', '2023-08-06 00:36:50');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1340, '仙女', 'Fairy', '描绘传说中具有仙力和魔法能力的幻想生物，通常拥有美丽的外貌和翅膀，象征神秘、魔幻和纯洁，常出现在童话故事、奇幻小说和艺术作品中。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:50', '2023-08-06 00:36:50');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1341, '上帝', 'God', '表示宇宙创造者或至高无上的神明，拥有无限的权力和智慧，是宗教和神话中的重要角色，被视为宇宙的创造者和统治者。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:50', '2023-08-06 00:36:50');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1342, '哥特风', 'Goth', '描绘哥特次文化的时尚风格，包括黑色衣着、浓妆和独特的审美，代表个性、另类和反传统，常用于时尚、音乐和艺术领域的表达和创作。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:50', '2023-08-06 00:36:50');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1343, '孩子', 'Kid', '描绘年幼的孩子，通常具有天真可爱的外貌和活泼好动的性格，是成长和童真的象征，常用于儿童图书、动画、广告等领域的创作和表现。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:50', '2023-08-06 00:36:50');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1344, '机器人', 'Robot', '机器人形象的角色。机器人可以是现实或幻想中的人工智能实体，具有机械结构和人类或非人类特征。通过绘画机器人，可以展现科技、未来、创新等主题，并呈现出独特的外观和特性。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:51', '2023-08-06 00:36:51');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1345, '水手', 'sailor', '水手是指从事航海工作的人员，通常指的是在船上工作的船员。在艺术中，水手形象常被描绘为穿着船员制服、驾驶船只或参与海上活动的人物。可以用于表达冒险、海洋和航海的主题。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:51', '2023-08-06 00:36:51');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1346, '士兵', 'Soldier', '描绘军队中的士兵，通常身穿军装和配备武器，代表忠诚、勇气和牺牲精神，常用于战争题材、军事描写和爱国主义主题的艺术作品和创作。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:51', '2023-08-06 00:36:51');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1347, '青少年', 'Teen', '描绘年轻的青少年，通常指年龄介于13至19岁之间的人，具有青春活力和独特的成长阶段特征，常用于描绘青春期、学校生活和成长故事的艺术创作。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:51', '2023-08-06 00:36:51');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1348, '战士', 'Warrior', '描绘具有强大战斗技能和勇敢精神的战士，通常身穿战斗装备和武器，代表勇气、力量和战斗精神，常出现在历史、幻想和游戏等作品中。', '角色', '角色', 0, '{}', 1, '2023-08-06 00:36:51', '2023-08-06 00:36:51');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1349, '3d(3D)', '3d', '模拟和绘制三维立体的作品，通过透视和光影效果表现出物体的深度和真实感，常用于电影、游戏和建筑等领域。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:23', '2023-08-06 00:39:23');
