INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1351, 'abstract expressionism(抽象表现主义)', 'abstract expressionism', '模拟和描绘抽象表现主义风格的作品，以抽象、自由和情感的表达为特征，强调画家的个人表现和内在体验的艺术形式。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:23', '2023-08-06 00:39:23');
