INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1359, 'bohemian(波西米亚)', 'bohemian', '波西米亚风格源于艺术家和自由思想家的生活方式，强调自由、放松和个性。AI绘画可以在这个风格中表现出丰富多彩的色彩、纹理和图案，创造出独特而舒适的视觉效果。它适用于室内设计、时尚、艺术作品等领域，为人们带来一种自由奔放和非传统的美感。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:24', '2023-08-06 00:39:24');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1360, 'brutalism(极简主义)', 'brutalism', '模拟和描绘极简主义风格的作品，以粗犷、坚固和功能性的建筑设计为特征，强调原始材料和简洁形式的美学表达。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:25', '2023-08-06 00:39:25');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1361, 'byzantine（拜占庭）', 'byzantine', '源于拜占庭帝国时期的艺术风格，强调宗教主题和装饰性，以金色、宝石色和复杂的几何图案为特征，表现出庄严、宏伟和神圣的氛围。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:25', '2023-08-06 00:39:25');
