INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1378, 'dbz style(龙珠风格)', 'dbz style', '模拟和描绘龙珠风格的作品，以《龙珠》系列动画的视觉风格和特征为基础，表现出动感、力量和英雄主义的漫画画风。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:27', '2023-08-06 00:39:27');
