INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1383, 'Elizabethan(伊丽莎白)', 'Elizabethan', '伊丽莎白时期的艺术风格，源于16世纪英国的伊丽莎白一世时代，以宫廷艺术和文化繁荣为特征，呈现出华丽、优雅和古典的元素，常见于建筑、绘画和戏剧作品中。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:28', '2023-08-06 00:39:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1384, 'Empire/Regency（帝国线式轮廓/摄政时期）', 'Empire/Regency', '摄政时期是指英国历史上乔治王朝的一段时期，大约从1811年到1820年。这个时期的艺术风格以古典和装饰性为特点，融合了希腊和罗马的元素，呈现出优雅、精致和奢华的特色。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:28', '2023-08-06 00:39:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1385, 'fauvism(野兽派）', 'fauvism', '20世纪初的一种艺术运动，强调用鲜艳的颜色和大胆的笔触表现情感，追求直接表达和感知色彩的力量，注重形式的简化和表达感觉而非现实', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:28', '2023-08-06 00:39:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1386, 'figurative expressionism(形象表现主义)', 'figurative expressionism', '模拟和描绘形象表现主义风格的作品，以夸张、变形和情感的形象表达为特征，追求内心世界和情绪的直接艺术表现。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:28', '2023-08-06 00:39:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1387, 'flat design(扁平设计)', 'flat design', '模拟和描绘扁平设计风格的作品，以简单、明确和图形化的元素表达信息和功能，常用于界面设计、品牌标识和插图等领域。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:28', '2023-08-06 00:39:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1388, 'folk art(民间艺术)', 'folk art', '模拟和描绘民间艺术风格的作品，以传统文化、手工艺和朴素形式为特征，反映特定地区和民族的艺术表达和文化传承。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:28', '2023-08-06 00:39:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1389, 'funkypop(Funkypop风格)', 'funkypop', '模拟和描绘Funkypop风格的作品，以时尚、流行和夸张的元素为特征，创造出充满趣味、活力和个性的艺术风格。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:29', '2023-08-06 00:39:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1390, 'geometric(几何)', 'geometric', '模拟和描绘几何形状和结构的作品，强调直线、曲线、角度和图案等几何元素，营造简洁、抽象和现代感的视觉效果。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:29', '2023-08-06 00:39:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1391, 'geometric painting(几何绘画)', 'geometric painting', '模拟和描绘几何绘画风格的作品，以几何形状、线条和图案为特征，追求形式的简化、精确和几何结构的艺术表现方式。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:29', '2023-08-06 00:39:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1392, 'ghibli(吉卜力)', 'ghibli', '模拟和描绘吉卜力工作室的视觉风格，以其细腻的绘画、温暖的故事和富有想象力的世界观而闻名，常用于动画电影的制作。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:29', '2023-08-06 00:39:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1393, 'Gibson（吉布森）', 'Gibson', '吉布森是指美国插图艺术家查尔斯·丹纳·吉布森创作的插图风格，主要出现在20世纪初的美国。吉布森插图以描绘都市生活、社交场景和时尚为特色，呈现出时代的风貌和人物的生动性。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:29', '2023-08-06 00:39:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1394, 'gothic(哥特式)', 'gothic', '展现出哥特文化的特点和氛围。这种场景常常包含浓厚的黑暗、神秘和古老的元素，传达出一种阴郁、奇幻和神秘的氛围。哥特式场景为作品带来独特的风格和情绪，适用于表达奇幻、恐怖或神秘的主题。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:29', '2023-08-06 00:39:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1395, 'graffiti art(涂鸦艺术)', 'graffiti art', '模拟和描绘涂鸦艺术风格的作品，以在公共空间创作的标签、图案和文字为特征，表达个人观点和城市文化的一种艺术形式。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:29', '2023-08-06 00:39:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1396, 'Highly detailed(高度详细)', 'highly detailed', '创建具有丰富细节和精确度的作品，强调细致的描绘和表现能', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:29', '2023-08-06 00:39:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1397, 'hyperrealism(超现实写实)', 'hyperrealism', '模拟和绘制超现实写实风格的作品，力求以极高的细节和逼真的效果再现现实世界中的人物、物体和场景。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:30', '2023-08-06 00:39:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1398, 'hyperrealistic anime(超写实动漫)', 'hyperrealistic anime', '模拟和描绘超写实动漫风格的作品，以逼真的细节、精湛的技巧和日本动漫的视觉风格为特征，呈现超现实的写实动画效果。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:30', '2023-08-06 00:39:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1399, 'illustration(插画)', 'illustration', '模拟和绘制插图风格的作品，用于视觉传达和故事叙述，常见于书籍、杂志、漫画和广告等领域。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:30', '2023-08-06 00:39:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1400, 'impressionism(印象派)', 'impressionism', '模拟和描绘印象派风格的作品，以快速的笔触、明亮的色彩和对光线和氛围的捕捉为特征，追求瞬间感和自然观察的艺术表现。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:30', '2023-08-06 00:39:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1401, 'isometric(等轴)', 'isometric', '模拟和描绘等轴投影的作品，通过等角度的投影表现出物体的立体感和空间关系，常用于游戏、建筑和工程设计等领域。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:30', '2023-08-06 00:39:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1402, 'kawaii(可爱)', 'kawaii', '模拟和描绘可爱风格的作品，以其可爱、天真和迷人的形象和元素而闻名，常用于日本流行文化和儿童相关的艺术和设计。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:30', '2023-08-06 00:39:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1403, 'kinetic art(运动艺术)', 'kinetic art', '模拟和描绘运动艺术风格的作品，以运动、变化和参与观众的互动为特征，通过光、声音和机械装置创造动态的艺术体验。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:30', '2023-08-06 00:39:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1404, 'low poly(低多边形)', 'low poly', '模拟和描绘低多边形风格的作品，以简化的几何形状和平面化的图像为特征，常用于游戏、建模和平面设计等数字艺术领域。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:31', '2023-08-06 00:39:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1405, 'mail art(邮件艺术)', 'mail art', '模拟和描绘邮件艺术的作品，以通过邮寄信件进行艺术创作和交流的方式为特征，强调艺术的民主性和全球性的交流网络。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:31', '2023-08-06 00:39:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1406, 'manga(漫画)', 'manga', '模拟和绘制日本漫画风格的作品，具有特有的线条风格、表情和故事叙述方式，常见于日本漫画和动画作品。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:31', '2023-08-06 00:39:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1407, 'manhua(漫画)', 'manhua', '模拟和描绘漫画风格的作品，以简化的线条、夸张的表情和幽默的故事叙述为特征，代表中国的传统漫画艺术形式。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:31', '2023-08-06 00:39:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1408, 'marvel(漫威)', 'marvel', '模拟和描绘漫威漫画的视觉风格，以其丰富的超级英雄、战斗场景和特殊效果而闻名，常用于漫画书和电影的创作和衍生品。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:31', '2023-08-06 00:39:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1409, 'memphis design(孟菲斯设计)', 'memphis design', '模拟和描绘孟菲斯设计风格的作品，以鲜艳的颜色、几何形状和装饰性图案为特征，追求鲜明、夸张和前卫的视觉效果。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:31', '2023-08-06 00:39:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1410, 'Military(军旅风格)', 'military', '军旅风格是一种时尚风格，受到军事服装和军队元素的启发。它通常包括军装外套、军用颜色、军徽标志、肩章、口袋等特征。AI绘画可以在这个风格中描绘具有军旅风格的服装、配饰或场景，展现出坚毅、严肃、有力和自信的特点，适用于时尚插画、服装设计等领域。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:31', '2023-08-06 00:39:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1411, 'minimalism(极简主义)', 'minimalism', '模拟和描绘极简主义风格的作品，以简洁、纯粹和精练的元素表达思想和情感，营造出宁静、平衡和空间感的视觉效果。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:32', '2023-08-06 00:39:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1412, 'Modern', 'modern', '模拟现代艺术风格，以抽象、实验和创新为特点。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:32', '2023-08-06 00:39:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1413, 'neo expressionism(新表现主义)', 'neo expressionism', '模拟和描绘新表现主义风格的作品，以激烈的笔触、夸张的形象和情感的表达为特征，强调个人和情绪的直观艺术体验。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:32', '2023-08-06 00:39:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1414, 'neo geo(新地质派)', 'neo geo', '模拟和描绘新地质派风格的作品，以鲜艳的色彩、几何形状和商业符号为特征，探索消费文化和视觉艺术之间的关系。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:32', '2023-08-06 00:39:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1415, 'neo impressionism(新印象派)', 'neo impressionism', '模拟和描绘新印象派风格的作品，以光影效果、色彩分割和快写风格为特征，表现主观感受和瞬间印象的艺术表达方式。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:32', '2023-08-06 00:39:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1416, 'neo minimalism(新极简主义)', 'neo minimalism', '模拟和描绘新极简主义风格的作品，以极简、减少和纯粹性为特征，追求简约、空间和形式的精确与平衡。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:32', '2023-08-06 00:39:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1417, 'neo suprematism(新至上主义)', 'neo suprematism', '模拟和描绘新至上主义风格的作品，以几何形状、纯粹色彩和抽象构图为特征，表现出超越现实和精神性的艺术表达方式。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:32', '2023-08-06 00:39:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1418, 'neoplasticism(新构成主义)', 'neoplasticism', '模拟和描绘新构成主义风格的作品，以几何形状、简化构图和纯粹色彩为特征，追求形式的均衡、和谐和普遍性的艺术表达。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:33', '2023-08-06 00:39:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1419, 'New Look(新风貌)', 'New Look', '新风貌是指克里斯汀·迪奥于1947年推出的时尚风格，以宽松的上身、收腰设计和大摆裙为特点，强调女性的曲线和优雅。AI绘画可以在这个风格中描绘具有新风貌特点的服装、造型或场景，展现出复古、浪漫和优雅的魅力，适用于时尚插画、时装设计等领域。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:33', '2023-08-06 00:39:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1420, 'New Nordic(新北欧风格)', 'New Nordic', '新北欧风格是对传统北欧风格的现代演绎，保留了简约、功能性和自然元素，同时加入了更多的创新和现代元素。AI绘画可以展示出新北欧风格的独特韵味，融合了传统和现代的设计特点，营造出时尚、舒适、精致的氛围，适用于室内设计、家居装饰、插画等领域，为空间带来一种时尚与温暖的感觉。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:33', '2023-08-06 00:39:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1421, 'Nordic(北欧)', 'Nordic', '北欧风格注重简约、功能性和自然元素，以明亮的色彩、清晰的线条和自然材料为特点。AI绘画可以呈现出清新、舒适、宜居的氛围，展示出北欧设计的特点和魅力，适用于室内设计、家居装饰、插画等领域，带来一种简洁、温暖和谐的感觉。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:33', '2023-08-06 00:39:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1422, 'octane render(Octane渲染)', 'octane render', '模拟使用Octane渲染引擎进行的作品绘制，Octane渲染引擎具有高质量、高速度和逼真的渲染效果。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:33', '2023-08-06 00:39:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1423, 'op art(欧普/光影艺术)', 'op art', '模拟和描绘光影艺术风格的作品，通过光线、色彩和图案的错觉和变化创造出视觉上的动态效果和幻觉体验。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:33', '2023-08-06 00:39:33');
