INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1436, 'Rococo(洛可可', 'rococo', '洛可可是18世纪欧洲的一种艺术风格，以优雅、曲线和装饰性强的设计为特征。它将华丽的装饰元素融入家具、绘画和建筑中，追求精致和浪漫的视觉效果，常表现出优雅、奢华和活泼的特点.', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:35', '2023-08-06 00:39:35');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1437, 'Sailor（水手）', 'sailor', '水手风格是一种时尚风格，灵感源自水手服装和海军元素。它通常包括蓝白条纹图案、领口细节、大按钮、帆船图案等特征。AI绘画在这个风格中可以描绘出具有水手风格的服装、配饰或场景，展示出时尚、清新、活力和海洋氛围的特点，适用于时尚插画、服装设计等领域。', '风格', '绘画风格', 1, null, 1, '2023-08-06 00:39:35', '2023-08-06 00:39:35');
