INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1516, 'Prismatic Highlights', 'prismatic highlights', '创造出棱镜折射产生的多彩高光效果，营造出光彩夺目和奇幻的视觉效果。', '灯光', '灯光', 1, null, 1, '2023-08-06 00:51:09', '2023-08-06 01:07:34');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1517, 'Rainbow Sparks', 'rainbow sparks', '模拟彩虹色的火花效果，创造出多彩、闪烁和欢乐的视觉效果，为作品增添活力和喜庆的氛围。', '灯光', '灯光', 1, null, 1, '2023-08-06 00:51:09', '2023-08-06 01:07:37');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1518, 'Electroluminescent Wire', 'electroluminescent wire', '使用电致发光材料制成的线，产生均匀和柔和的发光效果，常用于装饰和亮化作品。', '灯光', '灯光', 1, null, 1, '2023-08-06 00:51:09', '2023-08-06 01:07:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1519, 'Radioluminescence', 'radioluminescence', '模拟放射性物质产生的发光效果，创造出神秘、危险和科幻的视觉效果。', '灯光', '灯光', 1, null, 1, '2023-08-06 00:51:09', '2023-08-06 01:07:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1520, 'Glowing Particle Effects', 'glowing particle effects', '创造出发光的粒子效果，营造出神秘、幻想和科幻的视觉效果，为作品增添动态和魔力。', '灯光', '灯光', 1, null, 1, '2023-08-06 00:51:09', '2023-08-06 01:07:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1521, 'Dual Lighting', 'dual lighting', '使用两个或多个光源照亮物体或场景，创造出对比强烈、立体和戏剧性的视觉效果。', '灯光', '灯光', 1, null, 1, '2023-08-06 00:51:09', '2023-08-06 01:07:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1522, 'Bright(明亮)', 'Bright', '强调明亮的光线和色彩，为作品带来活力和光明感', '灯光', '灯光', 1, null, 1, '2023-08-06 00:51:09', '2023-08-06 01:07:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1523, 'Asymmetrical(非对称)', 'Asymmetrical composition', '一种创造不对称平衡感的构图技巧，通过将主要元素放置在画面的不同位置，创造出动态和有趣的视觉效果。非对称构图可以带来独特和引人入胜的组合，使画面更具视觉冲击力和个性。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:11', '2023-08-06 01:07:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1524, 'Background (背景)', 'Background', '图像中距离观察者最远的部分', '构图', '构图', 1, null, 1, '2023-08-06 00:52:11', '2023-08-06 01:07:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1525, 'Bokeh (背景虚化)', 'Bokeh', '通过使用大光圈、长焦距或特殊镜头制造背景模糊效果，使主体更突出、背景更柔和，创造艺术感和焦点效果。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:11', '2023-08-06 01:07:30');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1526, 'center(居中)', 'center', '将主要元素放置在画面的中心位置，创造出平衡和稳定感。居中构图可以带来简洁、整齐的视觉效果，使画面更加直接和集中，突出主题或主要元素。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:11', '2023-08-06 01:07:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1527, 'centered composition(居中构图)', 'centered composition', '一种将主要元素或主题放置在画面中心的构图技巧。通过将主题置于中心位置，居中构图可以创造出平衡、稳定的画面效果，并使主题成为观者的焦点。这种构图方式常用于强调主题的重要性或传达平静、稳定的氛围。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:11', '2023-08-06 01:07:42');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1528, 'contrasting composition(对比构图)', 'contrasting composition', '一种通过使用明显的对比元素来创造强烈视觉效果的构图技巧。通过在画面中巧妙地组合不同的元素、颜色、形状或明暗对比，对比构图可以引起观者的注意，并在作品中营造出鲜明的视觉对比，以增强视觉冲击力和艺术表现力。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:11', '2023-08-06 01:07:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1529, 'diagonal composition(对角线构图)', 'diagonal composition', '一种利用画面中的对角线线条来组织元素和主题的构图技巧。通过将主要元素沿着对角线线条摆放，对角线构图可以带来动态和流动感，同时引导观者的目光穿过画面，创造出视觉上的连贯和层次感。这种构图方式常用于创造张力、引导观者的目光或传达运动和活力的感觉。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:12', '2023-08-06 01:07:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1530, 'Foreground (前景)', 'Foreground', '图像中距离观察者最近的部分，用于增加层次感、创造透视效果或引导眼球注意主体，增强整体视觉效果。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:12', '2023-08-06 01:07:34');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1531, 'golden ratio(黄金比例)', 'golden ratio', '黄金比例是一种数学比例关系，常用于构图中的元素布局。它能够产生视觉上的和谐与美感，通过将画面分割为特定比例的区域，使作品具有平衡、稳定和吸引人的特点。黄金比例被广泛运用于绘画、摄影和设计等领域，以创造出优美而令人愉悦的视觉效果。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:12', '2023-08-06 01:07:37');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1532, 'Horizontal(水平构图)', 'Horizontal', '一种利用水平线条来组织元素和主题的构图技巧。通过将主要元素水平排列或与水平线平行摆放，水平构图可以传达稳定、平静和均衡的感觉。它常用于表达平和、宁静的情绪，或强调水平元素的重要性。水平构图也可以用于创造宽广的视觉效果和营造开放的氛围。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:12', '2023-08-06 01:07:37');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1533, 'Knolling(整齐摆放)', 'knolling', '将物体按一定规律排列、整齐摆放，创造出美观而有序的视觉效果', '构图', '构图', 1, null, 1, '2023-08-06 00:52:12', '2023-08-06 01:07:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1534, 'proportional(比例)', 'proportional', '指作品中各个元素之间的大小关系和比例的处理方式。良好的比例能够使作品看起来平衡、协调和美观，同时也能够引导观众的注意力和营造适宜的视觉效果。在绘画中，合理运用比例可以达到更好的视觉效果和表达意图。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:12', '2023-08-06 01:07:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1535, 'rule of thirds(三分构图)', 'rule of thirds', '将画面分为九等分，通过将主要元素或线条放置在交叉点上，或沿着这些线条排列，以创造出视觉平衡和吸引力。三分构图可以帮助艺术家创造出有趣、动态和对称的画面，增强视觉吸引力，并将注意力引导到重要的元素上。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:12', '2023-08-06 01:07:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1536, 'S-shaped(S形线条)', 'S-shaped', '使用呈S形状的线条或曲线元素来构建图像的一种构图技巧。S形线条可以带来流动感和动态感，增加作品的变化和趣味性，同时也能引导观众的目光流动，营造视觉上的平衡和和谐。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:12', '2023-08-06 01:07:37');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1537, 'symmetrical(对称)', 'symmetrical', '在作品中使用对称元素来创造一种平衡和和谐的视觉效果。通过对称的排列和镜像效果，可以使作品呈现出稳定、整齐和美观的感觉，增强作品的视觉吸引力和艺术效果。', '构图', '构图', 1, null, 1, '2023-08-06 00:52:13', '2023-08-06 01:07:39');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1538, 'Printing (印花)', 'printing', '一种在织物上印制图案或图像的技术，常用于制作服装和装饰品，可以为作品增添丰富的色彩和纹理。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:27', '2023-08-13 16:20:46');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1539, 'Hollow Out (镂空)', 'Hollow Out', '一种在织物上通过剪除或编织形成空洞或开口的技术，常用于制作透气、轻盈和具有装饰效果的服装和装饰品。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:28', '2023-08-13 16:20:46');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1540, 'Worn Out (磨损)', 'Worn Out', '一种在织物表面模拟磨损和破旧效果的纹理，常用于制作具有街头、废旧或时尚个性的服装和装饰品。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:28', '2023-08-13 16:20:46');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1541, 'Grinding White (磨白)', 'Grinding White', '一种通过机械或化学处理使织物表面变白或产生磨损效果的技术，常用于制作具有破旧、复古或个性化风格的服装和装饰品。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:28', '2023-08-13 16:20:46');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1542, 'Washing (洗水)', 'Washing', '一种通过对织物进行特殊处理，如漂洗、石洗或酸洗等，以使织物褪色、变软或产生磨损效果，常用于制作具有复古或破旧风格的服装。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:28', '2023-08-13 16:20:46');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1543, 'Beading (缀珠)', 'Beading', '一种在服装或装饰品上使用珠子进行装饰的技术，常用于增添闪亮、华丽和细节的效果，使作品更具视觉吸引力和质感。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:28', '2023-08-13 16:20:46');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1544, 'Fold (折痕)', 'Fold', '一种在织物上形成的折叠线条，可以是折叠过的织物或以折痕为设计元素的服装和装饰品，常用于增添层次感和结构性的效果。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:28', '2023-08-13 16:20:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1545, 'Brushed (精梳)', 'Brushed', '一种通过在织物表面梳理的处理方式，使织物纤维柔软而光滑，常用于制作柔软、舒适和保暖的服装和家居用品。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:28', '2023-08-13 16:20:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1546, 'Quilted (镂花)', 'Quilted', '一种通过将两层或多层织物进行填充和缝合形成的纹理效果，常用于制作厚实、保暖和具有层次感的服装和装饰品。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:28', '2023-08-13 16:20:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1547, 'Shoulder Dart (肩褶)', 'Shoulder Dart', '一种在服装上通过将织物折叠和缝合形成的凸起线条，用于提供贴合和塑造肩部轮廓的效果。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:29', '2023-08-13 16:20:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1548, 'French Dart (法式褶)', 'French Dart', '一种在服装上通过将织物折叠和缝合形成的凸起线条，用于提供贴合和塑造腰部轮廓的效果。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:29', '2023-08-13 16:20:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1549, 'Bust Dart (胸褶)', 'Bust Dart', '一种在服装上通过将织物折叠和缝合形成的凸起线条，用于提供贴合和塑造胸部轮廓的效果。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:29', '2023-08-13 16:20:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1550, 'Darts (飞片)', 'Darts', '一种在织物上形成V字形折叠线条的技术，常用于修剪和调整服装的贴合度，可以为作品增添线条和结构感。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:29', '2023-08-13 16:20:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1551, '集褶', 'Shirring', '一种通过在织物上连续拉紧并固定形成的集聚褶皱效果，常用于增添柔软和浪漫的服装和装饰品设计。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:29', '2023-08-13 16:20:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1552, 'Tucks (出褶)', 'Tucks', '一种在织物上形成小而紧密的折叠线条的技术，常用于增添纹理和细节的服装和装饰品设计。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:29', '2023-08-13 16:20:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1553, 'Nburst Pleat (N型褶)', 'Nburst Pleat', '一种在织物上形成N字形褶皱的技术，常用于制作独特和富有立体感的服装和装饰品设计。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:29', '2023-08-13 16:20:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1554, 'Box Pleat (盒子褶)', 'Box Pleat', '一种通过将织物沿特定方向交替折叠形成的均匀平行的褶皱效果，常用于增添结构和体积感的服装和装饰品设计', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:30', '2023-08-13 16:20:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1555, 'Accordion/Knife Pleat (扇贝褶)', 'Accordion/Knife Pleat', '一种通过在织物上沿特定方向交替折叠形成的褶皱效果，常用于制作具有立体感和动态效果的服装和装饰品', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:30', '2023-08-13 16:20:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1556, 'Transfer Printing (转印)', 'Transfer Printing', '一种将图案或图像从特殊纸上转移到织物上的技术，常用于制作图案复杂的服装和装饰品，可以为作品增添精细和多彩的效果。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:30', '2023-08-13 16:20:46');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1557, 'Tie Dyeing (扎染)', 'Tie Dyeing', '一种通过绑扎、压缩或折叠织物，然后将其浸入染料中进行染色的技术，常用于制作个性化的服装和装饰品，可以为作品增添动感和艺术性。', '风格', '工艺', 1, null, 1, '2023-08-06 00:53:30', '2023-08-13 16:20:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1558, 'Top view (顶视图) / Bird View (俯视）', 'Top view / Bird View', '以物体或场景的顶部为视角，俯瞰拍摄，用于展示整体布局、空间关系或环境特征。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:30', '2023-08-06 01:07:41');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1559, 'Aerial view (鸟瞰图)', 'Aerial view', '以高空的视角拍摄物体或场景，用于展示地理特征、城市景观或大范围的环境。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:30', '2023-08-06 01:07:41');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1560, 'Tilt-shift (移轴摄影)', 'Tilt-shift', '使用特殊的镜头或后期处理模拟移轴效果，使被拍摄的物体或场景看起来像微型模型，产生奇特的视觉效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:30', '2023-08-06 01:07:42');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1561, 'Satellite view (卫星视图)', 'Satellite view', '以卫星或空中摄影的视角拍摄物体或场景，用于展示地球或建筑物的俯瞰图像。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:30', '2023-08-06 01:07:40');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1562, 'Bottom view (底视图)', 'Bottom view', null, '视角', '视角', 1, null, 1, '2023-08-06 00:59:30', '2023-08-06 01:07:40');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1563, 'Front, Rear View (前视图、侧视图、后视图)', 'Front,  rear view', '分别以物体或场景的前部、侧部和后部为视角进行拍摄，用于展示不同方向的外观和特征。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:30', '2023-08-06 01:07:41');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1564, 'Product View (产品视图)', 'Product view', '以产品的特定角度和视角进行拍摄，突出产品的特点、设计和细节，用于展示产品的外观和功能。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:30', '2023-08-06 01:07:28');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1565, 'Extreme Closeup View (极端特写视图)', 'Extreme closeup view', '以极近距离拍摄物体或人物的细节部分，突出细微的纹理、表情或特征，用于展示物体或人物的细节。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:31', '2023-08-06 01:07:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1566, 'Look up (仰视)', 'Look up', '以向上仰望的视角拍摄物体或场景，用于展示高耸的建筑、树木或天空等特征，营造一种仰慕或震撼的情感。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:31', '2023-08-06 01:07:42');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1567, 'Selfie angle (自拍视角)', 'Selfie angle', '使用手持相机进行自拍时的视角，以自己为中心拍摄，用于展示自我形象、情绪或与他人的互动。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:31', '2023-08-06 01:07:31');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1568, 'Taking a selfie with a GoPro (自拍视角)', 'Taking a selfie with a GoPro', '使用GoPro相机进行自拍时的视角，以自己为中心拍摄，用于记录极限运动、户外冒险或特殊场景的经历。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:31', '2023-08-06 01:07:35');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1569, 'First-person view (第一人称视角)', 'First-person view', '以个人的视角和视线拍摄，让观看者体验到身临其境的感觉，适用于游戏、体验或记录个人经历。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:31', '2023-08-06 01:07:41');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1570, 'Isometric view (等距视图)', 'Isometric view', '以等距离和固定角度的视角拍摄物体或场景，使其呈现微缩模型的效果，用于展示结构、设计或布局的特点。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:31', '2023-08-06 01:07:35');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1571, 'Closeup view (特写视图)', 'Closeup view', '以近距离拍摄物体或人物的特定部分，突出细节和表情，用于强调关键元素或情感的传达。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:31', '2023-08-06 01:07:43');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1572, 'High angle view (高角度视图)', 'High angle view', '以较高的拍摄角度俯视物体或场景，用于改变观察者的视觉角度，强调物体的小型化或弱化人物的权威感。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:31', '2023-08-06 01:07:35');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1573, 'Microscopic view (显微视角)', 'Microscopic view', '以显微镜或显微摄影设备的视角拍摄微小的物体、生物或细胞结构，用于展示微观世界的奇妙和细节。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:32', '2023-08-06 01:07:36');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1574, 'Super side angle (超侧角)', 'Super side angle', '从侧面极端角度拍摄，突出主体的侧面特征和细节，创造独特的视觉效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:32', '2023-08-06 01:07:35');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1575, 'Third-person perspective (第三人称视角)', 'third-person perspective', '以第三人称的视角展现的，即玩家可以看到自己的角色以及周围环境，但相对于游戏中的世界和角色而言，玩家本人则处于游戏之外。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:32', '2023-08-06 01:07:43');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1576, 'Three-point perspective (三点透视)', 'Three-point perspective', '使用三个消失点的透视法绘制的视角，用于创造更复杂的空间感和透视效果，常用于科幻、奇幻或梦幻场景。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:32', '2023-08-06 01:07:34');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1577, 'Two-point perspective (两点透视)', 'two-point perspective', '使用两个消失点的透视法绘制的视角，用于创造深度感和空间透视，常用于建筑、城市景观和室内设计。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:32', '2023-08-06 01:07:41');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1578, 'Portrait (肖像)', 'portrait', '以人物为主题的绘画或摄影作品，着重表现人物的面部特征、情感或个性，用于展示个体形象和人物魅力。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:32', '2023-08-06 01:07:34');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1579, 'Elevation perspective (立面透视)', 'Elevation perspective', '以建筑物或场景的正面或侧面为视角，用于展示立体结构、比例关系和外观特征，常用于建筑设计和插图绘画。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:32', '2023-08-06 01:07:43');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1580, 'Ultra wide shot (超广角镜头)', 'ultra wide shot', '使用超广角镜头拍摄的视角，拥有极宽广的视野，用于捕捉广阔的场景、大自然景观或独特的环境设置。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:33', '2023-08-06 01:07:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1581, 'Headshot (爆头)', 'headshot', '以人物头部为主体的特写镜头，突出面部特征、表情和个性，常用于人物肖像、头像或艺术创作。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:33', '2023-08-06 01:07:35');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1582, 'cross-section view of 横截面图', 'cross-section view', '揭示内部结构、纹理和层次，用于解剖学、生物学或科学教育。比如核桃横截面的视角。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:33', '2023-08-06 01:07:46');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1583, 'Cinematic shot (电影镜头)', 'cinematic shot', '以电影的视觉风格和叙事手法为特点的镜头，通过构图、灯光和动态来营造电影般的氛围和戏剧效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:33', '2023-08-06 01:07:35');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1584, 'In focus (焦点对准)', 'in focus', '将镜头焦点精确对准主体或目标，使其清晰、锐利，背景或其他元素可能模糊，用于突出主题和创造焦点效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:33', '2023-08-06 01:07:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1585, 'Wide-angle view (广角镜头)', 'Wide-angle view', '使用广角镜头拍摄的视角，拥有较宽广的视野，适合捕捉广阔的场景、拍摄室内外建筑物或扩大透视效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:33', '2023-08-06 01:07:35');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1586, 'Depth of field (DOF) (景深)', 'depth of field (dof)', '指摄影中焦点前后的区域范围，景深较浅时，主体清晰而背景模糊；景深较深时，整个场景都清晰可见。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:33', '2023-08-06 01:07:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1587, 'Medium Close-Up (MCU) (中特写)', 'Medium Close-Up (MCU)', '介于特写和中景之间的镜头，更接近主体，突出面部特征和情感表达，常用于人物肖像或演员的情绪表现。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:34', '2023-08-06 01:07:36');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1588, 'Medium Shot (MS) (中景)', 'Medium Shot (MS)', null, '视角', '视角', 1, null, 1, '2023-08-06 00:59:34', '2023-08-06 01:07:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1589, 'Long Shot (LS) (远景)', 'Long Shot (LS)', '拍摄距离主体较远的镜头，用于展示广阔的环境、场景或人物在整个画面中的位置关系，呈现整体视觉效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:34', '2023-08-06 01:07:34');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1590, 'Over the Shoulder Shot (过肩景)', 'Over the Shoulder Shot', '从一个人的肩膀后方拍摄，展示其前方的视角和对话伙伴的部分身体，常用于对话场景中的交互和沟通展示。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:34', '2023-08-06 01:07:42');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1591, 'Loose Shot (松散景)', 'Loose Shot', '拍摄时留有一定的空白空间，给人一种松散、开放的感觉，适用于艺术照、时尚摄影或创意构图的拍摄风格。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:34', '2023-08-06 01:07:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1592, 'Two Shot (2S), Three Shot (3S), Group (两景(2S)，三景(3S)，群景)', 'Two Shot (2S), Three Shot (3S), Group', '拍摄两个人、三个人或一组人的镜头，用于展示人物之间的关系、互动或群体场景中的整体组合。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:34', '2023-08-06 01:07:45');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1593, 'Scenery Shot (风景照，空镜)', 'Scenery Shot', '专注于拍摄自然风光、城市景观或其他环境背景的镜头，突出美丽的风景和宏伟的自然元素。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:34', '2023-08-06 01:07:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1594, 'Bokeh (背景虚化)', 'Bokeh', '通过使用大光圈、长焦距或特殊镜头制造背景模糊效果，使主体更突出、背景更柔和，创造艺术感和焦点效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:34', '2023-08-06 01:07:44');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1595, 'Foreground (前景)', 'Foreground', '图像中距离观察者最近的部分，用于增加层次感、创造透视效果或引导眼球注意主体，增强整体视觉效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:35', '2023-08-06 01:07:36');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1596, 'Background (背景)', 'Background', '图像中距离观察者最远的部分', '视角', '视角', 1, null, 1, '2023-08-06 00:59:35', '2023-08-06 01:07:43');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1597, 'Detail Shot (ECU) (细节镜头)', 'Detail Shot (ECU)', '对主体进行极端特写，突出展示细节和纹理，常用于强调物体的特定部分或创造戏剧性的效果。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:35', '2023-08-06 01:07:32');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1598, 'Face Shot (VCU) (面部拍摄)', 'Face Shot (VCU)', '特写拍摄人物的面部，突出表情、眼神和面部特征，用于人像摄影、肖像照片或人物情感的表达。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:35', '2023-08-06 01:07:41');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1599, 'Knee Shot (KS) (膝盖以上)', 'Knee Shot (KS)', '拍摄人物从膝盖以上的部分，用于展示身体姿态、服装造型或特定的动作，常用于时尚、舞蹈或体育摄影。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:35', '2023-08-06 01:07:33');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1600, 'Full Length Shot (FLS) (全身照)', 'Full Length Shot (FLS)', '拍摄人物的整个身体，从头部到脚部，用于展示整体形象、姿态或服装造型，常用于时尚、街拍或人像摄影。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:35', '2023-08-06 01:07:32');
