INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1602, 'Waist Shot (Ws) (腰部以上)', 'Waist Shot (Ws)', '拍摄人物从腰部以上的部分，用于展示姿态、动作或服装造型，常用于时尚、舞蹈或人物特写摄影。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:36', '2023-08-06 01:07:29');
INSERT INTO prompt_tags (id, tag_name, tag_value, description, category, category_sub, tag_type, meta, status, created_at, updated_at) VALUES (1603, 'Extra Long Shot (ELS) (人在远方)', 'Extra Long Shot (ELS)', '以非常远的距离拍摄人物或场景，突出环境和空间的广阔感，强调人物的孤独、脆弱或与环境的联系。', '视角', '视角', 1, null, 1, '2023-08-06 00:59:36', '2023-08-06 01:07:30');
